Het verhaal draait om Ronal, een jonge barbaar met een laag zelfbeeld. Precies het tegenovergestelde van al die gespierde mannen in zijn dorp. Hij is een watje, maar het lot zorgt ervoor dat hij de enige is die zijn dorp van de ondergang kan redden wanneer de gemene Lord Volcazar alle barbaren ontvoert. Als enige overblijver zit er voor Ronal niets anders op dan een gevaarlijke tocht te ondernemen om zijn clan te bevrijden. Onderweg ontmoet hij ook nog Alibert, een slijmerige bard, Zandra, een bloedmooie strijdster en Elric, een metroseksuele elfengids.



